Fluffy like a cloud, this cake is amazing! 

INGREDIENTS
4 eggs, separated;
120 g (½ cup) sugar;
100g (1/2 cup + 2 tbsp) 00 flour;
100g (1/2 cup + 2 tbsp) cornstarch;
30 ml (2 tbsp) boiling water;
30 ml (2 tbsp) vegetable oil;
10 g (2 tsp) baking powder;
Vanilla extract.
METHOD
Whisk egg yolks with boiling water, oil, and vanilla.
Separately beat egg white, adding sugar in portions, until stiff peaks form.
Whisk flour with baking powder and cornstarch.
Start adding flour mixture into egg yolks, alternating with egg whites.
When smooth and airy batter forms, pour it into the cake pan and bake for 1 hour at 180C/350F.

